Health-Medical Documentary hosted by Andy Abrahams Wilson, published by Open Eye Films in 2008 - English narration


Information
------------------------------

Under Your Skin
A gripping tale of microbes, medicine &amp; money, UNDER OUR SKIN exposes the hidden story of Lyme disease, one of the most serious and controversial epidemics of our time. Each year, thousands go undiagnosed or misdiagnosed, often told that their symptoms are all in their head. Following the stories of patients and physicians fighting for their lives and livelihoods, the film brings into focus a haunting picture of the health care system and a medical establishment all too willing to put profits ahead of patients.

